import React, { useEffect, useState } from "react";
import AddIcon from "@mui/icons-material/Add";
import { useDispatch, useSelector } from "react-redux";
import { addDepartment } from "../../../redux/actions/adminActions";
import Spinner from "../../../utils/Spinner";
import { ADD_DEPARTMENT, SET_ERRORS } from "../../../redux/actionTypes";
import * as classes from "../../../utils/styles";
const Body = () => {
  const dispatch = useDispatch();
  const store = useSelector((state) => state);
  // const departments = useSelector((state) => state.admin.allDepartment);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState({});
  const [value, setValue] = useState({
    departmentName: "",
    departmentCode: "",
    contactNumber: "",
    email: "",
  });

  useEffect(() => {
    if (Object.keys(store.errors).length !== 0) {
      setError(store.errors);
      setValue({ ...value, email: "" });
    }
  }, [store.errors]);

  const handleSubmit = (e) => {
    e.preventDefault();
    setError({});
    setLoading(true);
    dispatch(addDepartment(value));
  };

  useEffect(() => {
    if (store.errors || store.admin.departmentAdded) {
      setLoading(false);
      if (store.admin.departmentAdded) {
        setValue({
          departmentName: "",
          departmentCode: "",
          contactNumber: "",
          email: "",
        });
        dispatch({ type: SET_ERRORS, payload: {} });
        dispatch({ type: ADD_DEPARTMENT, payload: false });
      }
    } else {
      setLoading(true);
    }
  }, [store.errors, store.admin.departmentAdded]);

  useEffect(() => {
    dispatch({ type: SET_ERRORS, payload: {} });
  }, []);

  return (
    <div className="flex-[0.8] mt-3">
      <div className="space-y-5">
        <div className="flex items-center space-x-2 text-gray-400">
          <AddIcon />
          <h1>Add Department</h1>
        </div>

        <div className="">
          <div className="">
            <div className="">
              <h1 className="">departmentName :</h1>
              <input
                placeholder="department Name"
                required
                className=""
                type="text"
                value={value.departmentName}
                onChange={(e) =>
                  setValue({ ...value, departmentName: e.target.value })
                }
              />
            </div>
            <div className="flex items-center justify-between">
              <div className="">
                <h1 className="">Department Code :</h1>
                <input
                  placeholder="Department Code"
                  required
                  className=""
                  type="text"
                  value=""
                  onChange={(e) =>
                    setValue({ ...value, departmentCode: e.target.value })
                  }
                />
              </div>
              <div className="">
                <button className="" type="submit">
                  Submit
                </button>
                <button
                  onClick={() => {
                    setValue({
                      departmentName: "",
                      departmentCode: "",
                      contactNumber: "",
                      email: "",
                    });
                    setError({});
                  }}
                  className=""
                  type="button"
                >
                  Clear
                </button>
              </div>
            </div>
            <div className="">
              <h1 className="">contactNumber :</h1>
              <input
                placeholder="contactNumber"
                required
                className=""
                type="text"
                value={value.contactNumber}
                onChange={(e) =>
                  setValue({ ...value, contactNumber: e.target.value })
                }
              />
            </div>
            <div className="">
              <h1 className="">Email :</h1>
              <input
                placeholder="Email"
                required
                className=""
                type="email"
                value={value.email}
                onChange={(e) => setValue({ ...value, email: e.target.value })}
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Body;
